import React from "react";
import { createUseStyles } from 'react-jss'

const useStyles = createUseStyles({
  container: {
    display: "block",
    width: "100%",
    marginTop: "30px"
  },
  exit: {
    margin: "auto auto",
    height: "min-content",
    width: "min-content",
    textAlign:"center",
    fontSize: "50px",
    transform: "rotate(45deg)",
    fontWeight: "200"
  },
  h1: {
    margin: "auto auto",
    marginTop: "30px",
    fontFamily: "Moderat",
    fontWeight: "200",
    letterSpacing: "normal",
    textAlign: "center",
  },
})

export default function AboutMeV2({ setPage }) {
  const classes = useStyles()

  return (
    <>
      <div className={classes.exit} onClick={() => setPage(null)}>+</div>
      <h1 className={classes.h1}>About Me</h1>
    </>
  )
}
